export const increase = () => {
  return {
    type: "INCREASE",
  };
};

export const decrease = () => {
  return {
    type: "DECREASE",
  };
};

export const getListData = (payload) => {
  return {
    type: "GETLISTS",
    payload,
  };
};

export function fetchList() {
  return (dispatch) => {
    let url = "https://jsonplaceholder.typicode.com/posts?_page=1";
  };
}
